import { images, useWindowDimensions } from '../constants'

function PushImage() {
  const { height, width } = useWindowDimensions()
  return (
    <div
      style={{
        overflow: 'hidden',
        height: height,
        width: width,
        backgroundColor: '#17191f',
        justifyContent: 'center',
        alignItems: 'center',
        display: 'flex',
      }}
    >
      <img
        src={'https://i.imgur.com/hPbfzZ2.png'}
        alt="Logo image T&C"
        style={{
          position: 'absolute',
          top: '0px',
          left: '0px',
          height: height * 0.09 - 26,
          marginTop: 13,
          marginBottom: 13,
          marginLeft: 10,
          marginRight: 13,
        }}
      />

      <div
        style={{
          width: width * 0.68,
          height: height * 0.45,
          backgroundColor: 'blue',
        }}
      >
        <div
          style={{
            width: width * 0.34,
            height: height * 0.45,
            backgroundImage: images.gojobg,
          }}
        ></div>
        <div
          style={{
            width: width * 0.34,
            height: height * 0.45,
          }}
        ></div>
        <div></div>
      </div>
    </div>
  )
}
export default PushImage
